import AuthContextProvider from "./context/AuthContextProvider";
import AppRoutes from "./routes/AppRoutes";
import { BrowserRouter } from "react-router-dom";

const App = () => {
  return (
    <AuthContextProvider>
      <BrowserRouter>
        <AppRoutes />
      </BrowserRouter>
    </AuthContextProvider>
  );
};

export default App;
